INSERT INTO `article` VALUES (1,1,1,'羽毛球發球','發球是所有羽毛球動作的基礎。「發球」是羽毛球規則用語，是指每一分開始時的擊球。發球應該要以下手進行，並低於發球者的腰部。上手發球違反羽毛球規則，會被認定是犯規。（物理學那些高速運動規則在這裡不適用！）','2021-01-04 00:00:00',2,2,'正常'),(2,1,2,'新北健行','新北三峽滿月圓國家森林遊樂區，一直以來都是大熱點滿月圓瀑布及處女瀑布更是他的兩大亮點加上他平穩步道規劃，很適合初心者、長輩來運動。','2021-01-04 00:00:00',5,1,'正常'),(3,1,3,'露營要換大車車嗎??','小弟想帶小朋友露營，可是家裡只有一台四門 tiida, 如果要1家4人要去的話，會不會裝備不夠放，我們不會有太多東西，都是一般基本必備的，有人可以給我建議嗎，謝謝','2021-01-04 00:00:00',3,1,'正常'),(4,1,4,'新手養貓詢問','由於第一次養貓 所以很興奮的囫圇吞棗的找了很多親訓的影片跟方式,但目前都沒什麼成效（或是沒有抓到要點）.現在每次靠近房間的時候都還沒開門妹妹一聽到房間外有聲音就馬上躲回自己的窩裡, 不再出來所以有些問題想要上來請益一下大家','2021-01-04 00:00:00',8,1,'正常'),(5,1,5,'工作壓力大怎麼辦','不應將辛勤工作與過度勞累混淆，以犧牲人際關係和身體健康為代價。即使您熱愛自己的工作，工作始終是具有壓力性的來源。工作壓力大在短期內，您可能會面臨壓力困擾、情緒低落，並且被要求按時完成任務或履行具有挑戰性的工種。您無法總是避免工作中出現的壓力。但是，您可以採取方法來管理與工作相關的壓力。','2021-01-04 00:00:00',1,1,'正常'),(6,1,6,'最新消息 接種AZ已486死 指揮中心','死亡再增加14例，目前AZ486死+莫德納92死=578死,呼籲指揮中心釐清死因','2021-01-04 00:00:00',100,1,'正常'),(7,1,7,'Mac玩暗黑2','請教各位 小弟最近買了一台MacBook air m1官網上似乎沒有Mac的載點 想請教各位如何運行暗黑2 謝謝含情是2代 3代運行正常','2021-01-04 00:00:00',11,1,'正常'),(8,1,8,'台版築地直送魚料！大分量厚切','想吃新鮮美味的日式料理，就一定要來仁愛市場２樓的「漁人手作壽司」！店內魚料海產皆為崁仔頂新鮮直送，厚實又肥美，經過職人烹調跟料理，變成美味的海鮮丼飯～目前已開放內用服務','2021-01-04 00:00:00',9,1,'正常'),(9,1,9,'辦理異地離婚需要什麼手續？','夫妻一方離開住所地超過1年，一方起訴離婚的案件，被告無經常居住的的，由原告起訴時居住地人民法院管轄，同時建議你的那個女生朋友以某種方式請求對方先起訴，這樣作為被告的女方法律規定被告為公民的，由被告的經常居住地人民法院管轄——這兩種方法都有可能幫助你的朋友在山東進行離婚訴訟。','2021-01-04 00:00:00',3,3,'正常'),(10,1,1,'羽毛球發球','發球是所有羽毛球動作的基礎。「發球」是羽毛球規則用語，是指每一分開始時的擊球。發球應該要以下手進行，並低於發球者的腰部。上手發球違反羽毛球規則，會被認定是犯規。（物理學那些高速運動規則在這裡不適用！）','2021-01-04 00:00:00',2,2,'正常'),(11,1,2,'新北健行','新北三峽滿月圓國家森林遊樂區，一直以來都是大熱點滿月圓瀑布及處女瀑布更是他的兩大亮點加上他平穩步道規劃，很適合初心者、長輩來運動。','2021-01-04 00:00:00',5,1,'正常'),(12,1,3,'露營要換大車車嗎??','小弟想帶小朋友露營，可是家裡只有一台四門 tiida, 如果要1家4人要去的話，會不會裝備不夠放，我們不會有太多東西，都是一般基本必備的，有人可以給我建議嗎，謝謝','2021-01-04 00:00:00',3,1,'正常'),(13,1,4,'新手養貓詢問','由於第一次養貓 所以很興奮的囫圇吞棗的找了很多親訓的影片跟方式,但目前都沒什麼成效（或是沒有抓到要點）.現在每次靠近房間的時候都還沒開門妹妹一聽到房間外有聲音就馬上躲回自己的窩裡, 不再出來所以有些問題想要上來請益一下大家','2021-01-04 00:00:00',8,1,'正常'),(14,1,5,'工作壓力大怎麼辦','不應將辛勤工作與過度勞累混淆，以犧牲人際關係和身體健康為代價。即使您熱愛自己的工作，工作始終是具有壓力性的來源。工作壓力大在