--

DROP TABLE IF EXISTS `reply`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `reply` (
  `reply_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '留言編號',
  `article_id` int(11) NOT NULL COMMENT '文章編號',
  `reply_user_id` int(11) NOT NULL COMMENT '留言者',
  `reply_content` varchar(50) NOT NULL COMMENT '留言內容',
  `reply_time` datetime NOT NULL COMMENT '留言時間',
  `reply_like_count` int(11) DEFAULT NULL COMMENT '案讚次數',
  `reply_status` varchar(50) NOT NULL COMMENT '留言狀態',
  `lastreplytime` datetime DEFAULT NULL COMMENT '最後回文時間',
  PRIMARY KEY (`reply_id`),
  KEY `article_id_idx` (`article_id`),
  KEY `reply_user_id_idx` (`reply_user_id`),
  CONSTRAINT `FK_comment_article_id` FOREIGN KEY (`article_id`) REFERENCES `article` (`article_id`),
  CONSTRAINT `FK_comment_reply_user_id` FOREIGN KEY (`reply_user_id`) REFERENCES `center`.`info` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=169 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
